class Video extends React.Component {
  changeSource() {

  }
  render() {
    return (
      <video
        id={this.props.id}
        className=""
        onEnded={() => videoEndHandler()}
        src={this.props.src}
      />
    );
  }
}

/* * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * */
/* Variables & Constants                                                       */
/* * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * */

const btnbox_playback = (
  <div className="ui-container-h ui-container-gap abs-left">
    <Btn
      id="btn_start"
      label="idle start"
      onClick={() => setNextMotion()}
    />
    <Btn
      id="btn_end"
      label="idle end"
      onClick={() => stopMotion()}
    />
  </div>
);

const btnbox_cam = (
  <div className="ui-container-h ui-container-gap abs-right">
    <Btn
      id="btn_cam"
      label="change cam"
      onClick={() => changeCam()}
    />
  </div>
);

const footer = (
  <div>
    {btnbox_playback}
    {btnbox_cam}
  </div>
);


/* * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * */
/* Output                                                                      */
